function updateVis() {
    module('lively.persistence.Debugging').load(true);

    var url = new URL(this.get('WorldURL').textString),
        fileEnding = url.filename().substr(url.filename().lastIndexOf('.') + 1);
    if (fileEnding == 'json') {
        var json = new WebResource(url)
            .get().content;
    } else {
        var doc = new WebResource(url)
            .get().contentDocument;
        var json = doc.getElementById('LivelyJSONWorld').textContent;
    }
    var jso = JSON.parse(json);

    var nodes = {},
        i =0,
        ignoreClasses =  this.get('IgnoreList').getList(),
        ignoredNodeIds = [],
        activeNodes = [],
        group = {},
        links  = [];

    Properties.own(jso.registry).forEach(function(id) {
        if (id == "isSimplifiedRegistry") return;

        var obj = jso.registry[id] 
        group[obj.__LivelyClassName__] = (group[obj.__LivelyClassName__] || 0) + 1
        if (ignoreClasses.include(obj.__LivelyClassName__ || 'undefined'))
             return;
        var classString = obj.__LivelyClassName__ ? " " +
            obj.__LivelyClassName__.replace(/.*\./,"") : ""
            nodes[id] = ({nodeName: ""+id+classString    , 
                id: id, index: i++, group: obj.__LivelyClassName__, obj: obj })
    })

    Properties.values(nodes).forEach(function(ea) {
        Properties.own(ea.obj)
            .select(function(eaProp) { return ea.obj[eaProp] 
                && ea.obj[eaProp].__isSmartRef__})
            .forEach(function(eaProp) {
                var ref = ea.obj[eaProp];
                var refID = ref.id
                if (!nodes[ea.id] || !nodes[refID]) return
                links.push({
                    name:  eaProp,
                    source: nodes[ea.id].index, 
                    target: nodes[refID].index, 
                    // sourceNode: nodes[ea.id],
                    // targetNode: nodes[refID],
                    value: 1})
            })
    })
    this.graph = {
        nodes: Properties.values(nodes).sortBy(function(ea) {return ea.index}), 
                links: links};
        this.get('ProtoVisGraph').setGraphAndRender(this.graph)

        this.get('GroupList').setList(Properties.own(group)
                .withoutAll(ignoreClasses)
                .sortBy(function(ea) { return group[ea] }).reverse()
                .collect(function(ea) {
                return {isListItem: true, string: group[ea] + ' ' + ea, 
                    value: {name: ea, count: group[ea]} }    
        }))
}

